import React from 'react'
import {View,Button,TextInput,Text} from 'react-native'

class Print extends React.Component {
    render() {
        const {arr}=this.props.arr;
        return(
            <View>
           
           return array.map((element) => {
       
        <View >
          <Text>{element.name}</Text>
        </View>
      
    });

            </View>
        )
    } 
  }

  export default Print;
